def compute_gsd(x,y):
    while y:
        x,y=y,x%y
    return x

def compute_lsm(x,y):
    return (x*y)//compute_gsd(x,y)

class Solution:
    def replaceNonCoprimes(self,a):
        r=[]
        for i in a:
            t=i
            while r and compute_gsd(r[-1],t)>1:
                t=compute_lsm(t,r.pop())
            r.append(t)
        return r
    
